import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonInput } from '@ionic/react';
import ExploreContainer from '../components/ExploreContainer';
import './Tab1.css';
var text ="";
if (localStorage.getItem('cellphone'))
{
  text = localStorage.getItem('cellphone')
}
const setText = (x:string) =>{
  localStorage.setItem('cellphone',x);
}
const Tab1: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Capturar Numero de Telefono</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent fullscreen>
        <IonHeader collapse="condense">
          <IonToolbar>
            <IonTitle size="large">Tab 1</IonTitle>
          </IonToolbar>
        </IonHeader>
        <IonInput value={text} placeholder="Numero de Celular" onIonChange={e => setText(e.detail.value!)}></IonInput>

      </IonContent>
    </IonPage>
  );
};

export default Tab1;
